import React, {Component} from 'react';

class MemeGenerator extends Component {
	constructor() {
		super();
		this.state = {
			someThing: ""
		}
	}
	
	render() {
		return (
			<div>
				<h1>MemeGenerators</h1>
			</div>
		)		
	}
}

export default MemeGenerator;
